window.bookSummaryJSON = "<p><b>Sahira’s biggest problems should be Orin and her inability to escape the Cursed Realm, but when something starts attacking her at night, she soon has more to worry about than the cruel, dark fae.</b></p> <p>Determined to break Sahira, Orin will do whatever it takes to win his game. He doesn’t expect the little witch to resist as much as she does, or for her to work her way under his skin.</p> <p>With The Reaping and certain death coming for them, they must work together to discover what is after Sahira and escape the realm….</p> <p><b>But can they survive without destroying each other?</b></p> <p><b>Return to the Shadow Realms. A world where vampires feast, lycans love deeply, dark fae seduce, witches cast their spells, dragons rule the skies...and treachery lurks around every corner.</b></p>"; 
